import React, { Component } from 'react';
import {Hero, HeroBody, HeroFooter, HeroHeader, Nav, NavLeft, NavItem, NavCenter,
Container, Icon, NavRight, Tabs, TabLink, Tab, Title, TabList, NavbarStart, NavbarEnd,
Button, NavbarItem, NavbarLink, NavbarDropdown} from 'bloomer';
import {Link} from 'react-router-dom';

export class HeroCard extends Component {
    render() {
        return (
            <Hero isColor='info' isSize='medium'>
                <HeroHeader>
                    <Nav>
                    </Nav>
                </HeroHeader>

                <HeroBody>
                    <Container hasTextAlign='centered'>
                        <Title>Title</Title>
                    </Container>
                </HeroBody>

                <HeroFooter>
                    <Tabs isBoxed isFullWidth>
                        <Container>
                            <TabList>
                                <Tab isActive><TabLink>Overview</TabLink></Tab>
                                <Tab><TabLink>Grid</TabLink></Tab>
                                <Tab><TabLink>Element</TabLink></Tab>
                                <Tab><TabLink>Components</TabLink></Tab>
                                <Tab><TabLink>Layout</TabLink></Tab>
                            </TabList>
                        </Container>
                    </Tabs>
                </HeroFooter>
                </Hero>
        );
    }
}

export default HeroCard;
